"use client"
import { useContext, useEffect, useState } from "react";
import { useRouter } from "next/navigation";
import { loginFormControls } from "../utils";
import InputComponent from "@/app/components/FormElements/InputComponent";
import { GlobalContext } from "../context";
import Cookies from "js-cookie";
import { login } from "@/services/login";
import Notification from "../components/Notification";
import { toast } from "react-toastify";
import ComponentLevelLoader from "../components/Loader/componentlevel";

const initialFormData = {
    email: '',
    password: ''
};

export default function Login() {
    const [formData, setFormData] = useState(initialFormData);
    const { isAuthUser, setIsAuthUser, user, setUser, componentLevelLoader, setComponentLevelLoader } = useContext(GlobalContext);
    const router = useRouter();

    function isValidForm() {
        return formData.email.trim() !== '' && formData.password.trim() !== '';
    }

    async function handleLogin() {
        setComponentLevelLoader({ loading: true, id: '' });
        const res = await login(formData);

        if (res.success) {
            toast.success(res.message, { position: "top-right" });
            setIsAuthUser(true);
            setUser(res?.finalData?.user);
            setFormData(initialFormData);
            Cookies.set('token', res?.finalData?.token);
            localStorage.setItem('user', JSON.stringify(res?.finalData?.user));
        } else {
            toast.error(res.message, { position: 'top-right' });
            setIsAuthUser(false);
        }
        setComponentLevelLoader({ loading: false, id: '' });
    }

    useEffect(() => {
        if (isAuthUser) router.push("/");
      }, [isAuthUser]);

    return (
        <div className="flex min-h-screen items-center justify-center">
            <div className="flex rounded-xl shadow-lg overflow-hidden w-[900px]">
                {/* Form Section */}
                <div className="w-1/2 p-10 flex flex-col justify-center">
                    <h2 className="text-3xl font-bold text-[#162d59]">Login</h2>
                    <p className="text-gray-600 mb-6">If you already a member, easily log in now.</p>
                    <div className="space-y-4">
                        {loginFormControls.map((controlItem) => (
                            <InputComponent
                                key={controlItem.id}
                                type={controlItem.type}
                                placeholder={controlItem.placeholder}
                                label={controlItem.label}
                                value={formData[controlItem.id]}
                                onChange={(event) => setFormData({
                                    ...formData,
                                    [controlItem.id]: event.target.value
                                })}
                            />
                        ))}
                        <button
                            className="w-full bg-black text-white py-3 rounded-lg font-semibold text-lg disabled:opacity-50"
                            disabled={!isValidForm()}
                            onClick={handleLogin}
                        >
                            {componentLevelLoader?.loading ? "Logging In..." : "Login"}
                        </button>
                       
                        <p className="text-center text-gray-500 text-sm">Forgot password?</p>
                        <div className="text-center">
                            <p>If you donâ€™t have an account...</p>
                            <button className="bg-black text-white px-6 py-2 mt-2 rounded-lg" onClick={() => router.push('/register')}>Register</button>
                        </div>
                    </div>
                </div>
                {/* Image Section */}
                <div className="w-1/2 cover-container" style={{ backgroundImage: "url('data:image/jpeg;base64,')" }}></div>
            </div>
            <Notification />
        </div>
    );
}
